#include <bits/stdc++.h>
using namespace std;

void print_vct(vector<int> &v)
{
    for (auto i : v)
        cout << i << " ";
    cout << endl;
}

class Solution
{
public:
    long long maxRunTime(int n, vector<int> &batteries)
    {
        // cout << n << endl;
        long long m = 0;
        // print_vct(batteries);
        priority_queue<int> q;
        for (auto b : batteries)
            q.push(b);

        while (true)
        {
            vector<int> bs;
            int mi=0;
            for (int i = 0; i < n; i++)
            {
                int b = q.top();
                mi =b;
                q.pop();
                if (b == 0)
                    return m;
                bs.push_back(b);
            }
            mi = max(1,mi/2);
            m+=mi;
            for (auto b : bs)
                q.push(b-mi);
        }
    }
};

int main()
{
    vector<int> input;
    input.push_back(3);
    input.push_back(3);
    input.push_back(3);
    Solution s;
    cout << s.maxRunTime(2, input) << endl;
}


